import GenericNode from './GenericNode';

export function OutputNode({ id }) {
  return (
    <GenericNode
      title="Output Node"
      className="output-node"
      inputHandles={[{ id: 'input' }]}
      nodeId={id}
    >
      <div>Output Value</div>
    </GenericNode>
  );
}
